import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Wait for product cards to be rendered by the script
    await page.waitForSelector('.product-card .add-to-cart', { timeout: 5000 });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // --- Rapidly add multiple items to the cart ---
    const addToCartButtons = await page.locator('.add-to-cart').all();
    if (addToCartButtons.length < 4) {
        throw new Error('Not enough "Add to Cart" buttons found to perform the test.');
    }
    // Click the first 4 buttons in quick succession
    await Promise.all([
        addToCartButtons[0].click(),
        addToCartButtons[1].click(),
        addToCartButtons[2].click(),
        addToCartButtons[3].click(),
    ]);

    // Wait for the cart counter to update to "4"
    await page.waitForFunction(() => document.querySelector('div.cart').innerText.trim().startsWith('4'));

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Open the cart and verify items ---
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { state: 'visible' });

    const initialItemCount = await page.locator('.cart-item').count();
    if (initialItemCount !== 4) {
        throw new Error(`Expected 4 items in cart, but found ${initialItemCount}.`);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // --- Manipulate item quantities ---
    // Increase quantity of the first item by 2
    const firstItemIncreaseBtn = page.locator('.cart-item').first().locator('.quantity-btn').nth(1);
    await firstItemIncreaseBtn.click();
    await firstItemIncreaseBtn.click();

    // Decrease quantity of the second item by 1
    const secondItemDecreaseBtn = page.locator('.cart-item').nth(1).locator('.quantity-btn').first();
    await secondItemDecreaseBtn.click();

    // Wait for quantity of the first item to become "3"
    await page.waitForFunction(() => document.querySelector('.cart-item .quantity').innerText.trim() === '3');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantities_changed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantities_changed.png'));

    // --- Remove an item from the cart ---
    await page.locator('.cart-item .remove-item').nth(2).click(); // Remove the 3rd item

    // Wait for the number of items in the cart to become 3
    await page.waitForFunction(() => document.querySelectorAll('.cart-item').length === 3);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_item_removed.png'));

    // --- Clear the rest of the items from the cart ---
    const removeButtons = await page.locator('.cart-item .remove-item').all();
    for (const button of removeButtons) {
        await button.click();
    }

    // Wait for the empty cart message to appear
    await page.waitForSelector('.empty-cart', { state: 'visible' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_cart_cleared.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_cart_cleared.png'));

    // Final verification: check main page cart counter
    const finalCartText = await page.locator('div.cart').textContent();
    if (!finalCartText.trim().startsWith('0')) {
        throw new Error(`Cart counter did not reset to 0. Current text: ${finalCartText}`);
    }

    const extractedData = {
      initialItemCount: initialItemCount,
      finalCartText: finalCartText.trim()
    };

    return {
      success: true,
      action: "Successfully performed rapid cart manipulation stress test.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    const errorScreenshotPath = path.join(screenshotsDir, 'error_state.png');
    await page.screenshot({ path: errorScreenshotPath });
    screenshots.push(errorScreenshotPath);

    return {
      success: false,
      action: "Failed to complete the cart manipulation stress test.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
